import React, { useState } from 'react';

const HealthForm = () => {
    const [formData, setFormData] = useState({
        age: '',
        height: '',
        weight: '',
        activityLevel: '',
        gender: '',
        dailyWaterIntake: '',
        sleepHours: '',
        stressLevel: '',
    });

    const handleChange = (name, value) => {
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = async () => {
        const data = await fetchData('/predict', formData);
        console.log('Erhaltene Daten:', data);
        // Du kannst die Daten hier anzeigen oder weiterverarbeiten
    };

    return (
        <div style={styles.container}>
            <label>Alter:</label>
            <input style={styles.input} value={formData.age} onChange={e => handleChange('age', e.target.value)} />
            <label>Größe (cm):</label>
            <input style={styles.input} value={formData.height} onChange={e => handleChange('height', e.target.value)} />
            {/* Weitere Felder hier */}
            <button onClick={handleSubmit}>Absenden</button>
        </div>
    );
};

const styles = {
    container: {
        padding: '20px',
    },
    input: {
        height: '40px',
        borderColor: 'gray',
        borderWidth: '1px',
        marginBottom: '10px',
        paddingLeft: '8px',
        display: 'block',
    },
};

export default HealthForm;
